":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/11\\/545.png\",\"id\":368},\"align\":\"center\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"2e6e560\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"c5a77f7\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Yo ingrese al Centro de Bachillerato Tecnologico Industrial y de Servicios 236\\u00b0, yo me hab\\u00eda inclinado principalmente por puericultura, al final de cuentas por una raz\\u00f3n que no me gusta mencionar pero a la vez agradezco mucho ya que gracias a eso yo estoy aqu\\u00ed estudiando en la Ingenieria de Tecnolog\\u00edas de la informaci\\u00f3n. Los primeros semestres vimos bases de datos, java, dise\\u00f1o de p\\u00e1ginas web, e-learning, comercio electronico, sistemas operativos entre muchas m\\u00e1s, materias que fueron de mi agrado y gracias a eso, mi amor por la inform\\u00e1tica.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"3762d1b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"3e977ac\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"4cddd68\",\"elType\":\"widget\",\"settings\":{\"address\":\"cd victoria tamaulipas cbtis 236\"},\"elements\":[],\"widgetType\":\"google_maps\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"f22191a\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"0b2f666\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"041605b\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/UP_Victoria.png\",\"id\":464}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"28262d8\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"2852585\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Actualmente ingrese el 2 de septiembre a la poderosima Universidad Pol\\u00edtecnica de Victoria, a la ingenieria de Tecnolog\\u00edas de la informaci\\u00f3n.<\\/p>\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":0,\"unit\":\"px\"},\"_offset_y\":{\"size\":85,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"38e475b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"c8b025b\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"e2ba3d0\",\"elType\":\"widget\",\"settings\":{\"address\":\"Cd Victoria Mexico universidad politecnica de victoria\"},\"elements\":[],\"widgetType\":\"google_maps\"}],\"isInner\":false}],\"isInner\":false}]'),
