rez, m\\u00e1s antes estuve en la primaria Elvira Salda\\u00f1a Morales, quiero hablar acerca de algo que quiz\\u00e1 desvi\\u00f3 mucho lo que realmente yo quer\\u00eda en la vida, primero que nada yo desde ni\\u00f1a siempre quise ser maestra, incluso aun estando en la secundaria quer\\u00eda seguir siendo maestra de eduaci\\u00f3n especial, inclusive entre al cbtis 236 solo por la especialidad de puericultura, cosa que a \\u00faltima hora termine escogiendo: Programaci\\u00f3n, un momento de mi vida si me arrepent\\u00ed porque fue un giro muy inesperado, claro, no creo que tenga que ver mucho una carrera con otra. Cosa que no me arrepiento ni un segundo de mi vida, conoc\\u00ed personas que tuvieron un gran impacto en mi vida, y ahora estoy aqu\\u00ed, en la universidad Polit\\u00e9cnica de Victoria, en la carrera de Tecnolog\\u00edas de la informaci\\u00f3n.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true},{\"id\":\"7e83e33\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"b51f0f4\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/11\\/IMG-20191006-WA0143.jpg\",\"id\":365}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":true}],\"isInner\":true}],\"isInner\":false}],\"isInner\":false},{\"id\":\"ca0db6b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"d73d81a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"f579a9d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"f948a31\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"592565d\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"2f0ba22\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/11\\/545.png\",\"id\":368},\"align\":\"center\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"2e6e560\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"c5a77f7\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Yo ingrese al Centro de Bachillerato Tecnologico Industrial y de Servicios 236\\u00b0, yo me hab\\u00eda inclinado principalmente por puericultura, al final de cuentas por una raz\\u00f3n que no me gusta mencionar pero a la vez agradezco mucho ya que gracias a eso yo estoy aqu\\u00ed estudiando en la Ingenieria de Tecnolog\\u00edas de la informaci\\u00f3n. Los primeros semestres vimos bases de datos, java, dise\\u00f1o de p\\u00e1ginas web, e-learning, comercio electronico, sistemas operativos entre muchas m\\u00e1s, materias que fueron de mi agrado y gracias a eso, mi amor por la inform\\u00e1tica.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"3762d1b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"3e977ac\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"4cddd68\",\"elType\":\"widget\",\"settings\":{\"address\":\"cd victoria tamaulipas cbtis 236\"},\"elements\":[],\"widgetType\":\"google_maps\"}],\"isInner\":false}],\"isInner\":false}]'),
