(1472, 431, '_elementor_data', '[{\"id\":\"210081d\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"d4775a3\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"ea49723\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":131,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"fbb5699\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"bf16813\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"5606542\",\"elType\":\"widget\",\"settings\":{\"title\":\"Mis gustos y d\\u00e9mas\",\"size\":\"xl\",\"header_size\":\"h4\",\"align\":\"center\",\"title_color\":\"#ad66d1\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Belgrano\",\"typography_text_decoration\":\"underline\",\"_animation\":\"fadeIn\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"639c137\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"599f74f\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"f319df9\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Algo que a mi en lo personal me gusta mucho son los super heroes, por todo lo que significan para mi, siempre buscan un bien com\\u00fan y el como le dan esperanza\\u00a0a las personas con una simple sonrisa, es lo que a mi me hace amarlos, incluso si son ficticios, llegan a ser mi motivaci\\u00f3n cuando no se como levantarme de los golpes de la vida.<\\/p>\",\"align\":\"center\",\"text_color\":\"#0c0c0c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Verdana\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"50a23e2\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"75863bc\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"7a6dbd4\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/840653.jpg\",\"id\":434},\"image_size\":\"medium_large\",\"_animation\":\"fadeIn\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"b825df5\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"8c514cf\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>All Might, el es un personaje protagonista del anime Boku No hero Academia, ha logrado atraparme en verdad ya que siempre le da esperanza a las personas con su simple sonrisa, a pesar de ya no poder mas siempre vas a admirar a este heroe, me gusta su ideolog\\u00eda, querer salvar a todos, tiene ese carisma que te hace amarlo y admirarlo, por mucho es uno de mis favoritos.<\\/p>\",\"align\":\"center\",\"text_color\":\"#0c0c0c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Verdana\",\"_padding\":{\"unit\":\"px\",\"top\":\"-13\",\"right\":\"-13\",\"bottom\":\"-13\",\"left\":\"-13\",\"isLinked\":true},\"_animation\":\"fadeIn\",\"_element_vertical_align\":\"flex-end\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":5,\"unit\":\"px\"},\"_offset_y\":{\"size\":68,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4453221\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"e0e7087\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"de374a4\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>C\\u00e1pitan \\u00c1merica, este personaje que quiz\\u00e1 sea odiado por muchos es uno de mis favoritos por mucho tiempo, Steve Rogers fue un soldado que despert\\u00f3 70 a\\u00f1os despu\\u00e9s de la epoca en la que viv\\u00eda, as\\u00ed tendiendo que dejar sin querer a la mujer que amaba, \\u00bfdific\\u00edl no? Ser parte de la iniciativa avengers, siendo como uno de los mas fuertes y siendo ese s\\u00edmbolo para demostrarnos que el mal puede ser confrontado y golpeado. Si has visto End Game no me puedes decir que la escena de Steve Rogers con Thanos no te emociono.<\\/p>\",\"text_color\":\"#0c0c0c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Verdana\",\"_margin\":{\"unit\":\"px\",\"top\":\"3\",\"right\":\"3\",\"bottom\":\"3\",\"left\":\"3\",\"isLinked\":true},\"_padding\":{\"unit\":\"px\",\"top\":\"-20\",\"right\":\"-20\",\"bottom\":\"-20\",\"left\":\"-20\",\"isLinked\":true},\"_animation\":\"fadeIn\",\"_element_width\":\"inherit\",\"_element_vertical_align\":\"center\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":6,\"unit\":\"px\"},\"_offset_y\":{\"size\":40,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"ad1fd0d\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"ba6768a\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/25152bf1f675955967e69bbcf3ac9f07.jpg\",\"id\":436},\"_animation\":\"fadeIn\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"6ea5588\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"32f1fc2\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"fd31ebe\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/images.jpg\",\"id\":440},\"_animation\":\"fadeIn\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":0,\"unit\":\"px\"},\"_offset_y\":{\"size\":62,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"1a2dd8c\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"3cb93b2\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Spiderman, este personaje me ha inspirado mucho, porque es tan incre\\u00edble su multiverso y todo lo que respecta, hablemos de Peter Parker uno de los mas famosos portadores de la m\\u00e1scara, ya que no es el \\u00fanico que puede portarla, como ya hemos visto en la \\u00faltima entrega de Spiderman Into Tht Spideverse, nos podemos dar cuenta de que existen en otras dimensiones otros portadores de la m\\u00e1scara, dandonos a entender que cualquiera puede usarla, cualquiera puede ser el afortunado de ser mordido por la ara\\u00f1a. No importa cuantas veces me caiga siempre encuentro la forma de levantarme, es una de mis frases favoritas de este super heroe.<\\/p>\",\"text_color\":\"#0c0c0c\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Verdana\",\"_animation\":\"fadeIn\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"e3d8d1a\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"3bdf127\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"9b8a9ce\",\"elType\":\"widget\",\"settings\":{\"youtube_url\":\"https:\\/\\/www.youtube.com\\/watch?v=BBjU06ETaaI\",\"vimeo_url\":\"https:\\/\\/vimeo.com\\/235215203\",\"dailymotion_url\":\"https:\\/\\/www.dailymotion.com\\/video\\/x6tqhqb\"},\"elements\":[],\"widgetType\":\"video\"}],\"isInner\":false},{\"id\":\"0a71e74\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"0d07a1e\",\"elType\":\"widget\",\"settings\":{\"youtube_url\":\"https:\\/\\/www.youtube.com\\/watch?v=favVWVagesM\",\"vimeo_url\":\"https:\\/\\/vimeo.com\\/235215203\",\"dailymotion_url\":\"https:\\/\\/www.dailymotion.com\\/video\\/x6tqhqb\"},\"elements\":[],\"widgetType\":\"video\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"60d3d22\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7b4f7