(1608, 461, '_elementor_data', '[{\"id\":\"97b9184\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"4cfabeb\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"9c3d628\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"9b36074\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"fa997d8\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"f79b7b0\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":124,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"b4bc4f4\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"cee78c1\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"d355895\",\"elType\":\"widget\",\"settings\":{\"title\":\"Mis personas favoritas\",\"size\":\"xxl\",\"align\":\"center\",\"title_color\":\"#82275f\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Allerta\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4e937b4\",\"elType\":\"section\",\"settings\":{\"structure\":\"33\"},\"elements\":[{\"id\":\"24b82aa\",\"elType\":\"column\",\"settings\":{\"_column_size\":25,\"_inline_size\":null},\"elements\":[{\"id\":\"546e5b5\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Jes\\u00fas, muchos quiz\\u00e1 pensaran o se burlaran, por que s\\u00ed, el es mi novio y es de las personas que justo ahora es a la cual le agradezco todo, porque desde un principio lleg\\u00f3 a mi vida en un momento muy critico, en verdad cuando digo que me salv\\u00f3, es porque lo hizo, siempre me ayudo cuando yo ya no pod\\u00eda m\\u00e1s, alegraba mis d\\u00edas cuando yo ya no les ve\\u00eda sentido.<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Tahoma\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":-1,\"unit\":\"px\"},\"_offset_y\":{\"size\":23,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"958c7ce\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"9506d74\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/IMG_z7gmou.jpg\",\"id\":444},\"image_size\":\"medium\",\"align\":\"center\",\"_animation\":\"fadeInUp\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":0,\"unit\":\"px\"},\"_offset_y\":{\"size\":42,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false},{\"id\":\"783d839\",\"elType\":\"column\",\"settings\":{\"_column_size\":25,\"_inline_size\":null},\"elements\":[{\"id\":\"463c023\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>A\\u00fan con eso el nunca se fue, cuando por fin lo conoc\\u00ed en persona fue como si ya lo conociera de a\\u00f1os y simplemente agradec\\u00eda por todo lo malo que me pas\\u00f3, porque gracias a eso conoc\\u00ed a esta maravillosa persona que siempre me ha impulsado a salir adelante, que a donde quiera que vaya siempre va a brillar, nunca voy a agradecerte por salvarme, por darle estabilidad a mi vida y hacerla mejor cada d\\u00eda &lt;3<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Tahoma\",\"_offset_x\":{\"size\":1,\"unit\":\"px\"},\"_offset_y\":{\"size\":-5,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"14ce784\",\"elType\":\"section\",\"settings\":{\"structure\":\"22\"},\"elements\":[{\"id\":\"255418d\",\"elType\":\"column\",\"settings\":{\"_column_size\":66,\"_inline_size\":null},\"elements\":[{\"id\":\"e6692bc\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/IMG_20190326_121725.jpg\",\"id\":445},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"5752198\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false},{\"id\":\"16353cb\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"bb69bd4\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Se que no es una persona, pero es un miembro de mi familia, y el bien que nos ha echo desde su llegada, el significado que tiene para nosotros, es mi mejor amigo porque siempre me saca sonrisas, cuando estoy triste siempre esta ah\\u00ed tratando solo de entender porque a veces no quiero jugar, es tan adorable y tierno, todos saben la importancia que tiene en mi vida y cuanto lo quiero, es el chihuahua mas hermoso de todos.<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Tahoma\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":3,\"unit\":\"px\"},\"_offset_y\":{\"size\":64,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"62b07c2\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"3f02f8e\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"692a873\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Michito es un gatito que llego a mi casa hace poco mas de un mes, cabe recalcar que a mi no me gustan para nada los gatos por el motivo de que todos los que hab\\u00eda tenido se iban y nunca regresaban o simplemente no me quer\\u00edan, michito desde un principio como era rescatado de la calle era muy peque\\u00f1o y d\\u00e9bil, pero con el tiempo fue tomando fuerzas y siempre dorm\\u00eda en mi pecho, se acostumbr\\u00f3 a mi hogar y ahora es parte de la familia, a veces en las ma\\u00f1anas me acompa\\u00f1a a tomar el autobus para irme a la escuela, o me ronronea mucho, le he llegado a tomar mucho cari\\u00f1o y ahora es muy importante para mi<\\/p>\",\"_position\":\"absolute\",\"_offset_x\":{\"size\":3,\"unit\":\"px\"},\"_offset_y\":{\"size\":48,\"unit\":\"px\"}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"4d70a4e\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"85fed64\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/204.48.23.153\\/chanisdark\\/wp-content\\/uploads\\/2019\\/12\\/IMG_20191109_173953.jpg\",\"id\":449},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a0dfeb3\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"44b0bf6\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"d5d5326\",\"elType\":\"widget\",\"settings\":{\"button_type\":\"info\",\"text\":\"\",\"link\":{\"url\":\"https:\\/\\/www.youtube.com\\/watch?v=WM62OS4zIik\",\"is_external\":\"\",\"nofollow\":\"\"},\"align\":\"center\",\"selected_icon\":{\"value\":\"fas fa-dog\",\"library\":\"fa-solid\"}},\"elements\":[],\"widgetType\":\"button\"}],\"isInner\":false}],\"isInner\":false}]'),
