(55, 1, '2019-01-08 13:16:15', '2019-01-08 13:16:15', '<!--  /.horizontal-border -->\n		            			            			                <h2>BIENVENIDO </h2>\n		            			            			                <h2>SANDRA TRISTÁN</h2><!--  /.hero-title -->\n		            			            			                <ul>\n		                			                		<li></li>\n		                			                </ul><!--  /.hero-designation -->\n		            			            <!--  /.col-lg-8 -->\n		        <!--  /.row -->\n			<!--  /.container-xl -->\n		    			        <!--  /.hg-background-image -->\n		    			    <!--  /.hg-background -->\n		<!--  /.hero-block -->\n										<img width=\"223\" height=\"300\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/FB_IMG_1560986930129-223x300.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/FB_IMG_1560986930129-223x300.jpg 223w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/FB_IMG_1560986930129-768x1034.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/FB_IMG_1560986930129-760x1024.jpg 760w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/FB_IMG_1560986930129.jpg 1520w\" sizes=\"(max-width: 223px) 100vw, 223px\" />											\n		<h1><strong>¿Quién soy? </strong></h1><strong> </strong><strong> </strong><b>Me llamo Sandra Yaneth Tristán Soto, actualmente tengo 18 años de edad. Soy alumna de primer cuatrimestre de la universidad Politécnica de Victoria, si quieres seguir averiguando más sobre mi persona quedate aquí y disfruta de mi página ;)</b><p>Da click en el icono de abajo para así poder conocer mas de uno de mis hobbies favoritos y disfrutar de la galeria de imágenes.</p>		\n			<a href=\"http://204.48.23.153/chanisdark/?page_id=253\">\n						</a>\n										<img width=\"240\" height=\"300\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191121_191529_460-240x300.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191121_191529_460-240x300.jpg 240w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191121_191529_460-768x960.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191121_191529_460-819x1024.jpg 819w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191121_191529_460.jpg 958w\" sizes=\"(max-width: 240px) 100vw, 240px\" />											\n		https://www.youtube.com/watch?v=AsRcYd6fmqg&#038;t=10s<h1>Este es un vídeo realizado por mi, de la materia herramientas ofimáticas.</h1>		\n											<a href=\"http://204.48.23.153/chanisdark/?page_id=278\" data-elementor-open-lightbox=\"\">\n							<img width=\"768\" height=\"432\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/70177831_2441621776082665_6916643877831049216_n-768x432.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/70177831_2441621776082665_6916643877831049216_n-768x432.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/70177831_2441621776082665_6916643877831049216_n-300x169.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/70177831_2441621776082665_6916643877831049216_n.jpg 960w\" sizes=\"(max-width: 768px) 100vw, 768px\" />								</a>\n		<h3>Da click en la imágen de arriba para poder ver más sobre mi :)</h3>		\n			<h4><a href=\"http://204.48.23.153/chanisdark/?page_id=431\">Gustos y más</a></h4>		\n										<img width=\"300\" height=\"199\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/hipertextual-ver-avengers-endgame-4k-2019810743-300x199.jpeg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/hipertextual-ver-avengers-endgame-4k-2019810743-300x199.jpeg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/hipertextual-ver-avengers-endgame-4k-2019810743.jpeg 740w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n		<p>Uno de mis gustos sin dudarlo, son los super heroes, tengo mas favoritismo uno de otro, ya que en mi representan muchisimo y son un ejemplo a seguir.</p>		\n										<img width=\"1020\" height=\"847\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20190906_191406_667-1024x850.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20190906_191406_667-1024x850.jpg 1024w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20190906_191406_667-300x249.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20190906_191406_667-768x638.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20190906_191406_667.jpg 1080w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" />											\n		<p>Negrito es mi mejor amigo y mi compañero, el tiene 11 años,es el chihuahua mas noble y tierno del mundo, significa mucho para mi y lo amo con todo mi corazón, espero que pueda estar conmigo muchos años mas </p>		\n		<h2>Da click en el botón de abajo para ver algo de mi futuro</h2>		\n			<a href=\"http://204.48.23.153/chanisdark/?page_id=267\" role=\"button\">\n					</a>\n											<a href=\"http://204.48.23.153/chanisdark/?page_id=442\" data-elementor-open-lightbox=\"\">\n							<img width=\"1020\" height=\"573\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG-20191027-WA0017-1024x575.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG-20191027-WA0017-1024x575.jpg 1024w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG-20191027-WA0017-300x169.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG-20191027-WA0017-768x431.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG-20191027-WA0017.jpg 1280w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" />								</a>\n			<h2>¿Quieres saber el porque de esta foto?<br>&lt;-</h2>		\n				<iframe title=\"Steven Universe the movie: Change by Liset Ramos\" width=\"1020\" height=\"200\" scrolling=\"no\" frameborder=\"no\" src=\"https://w.soundcloud.com/player/?visual=false&#038;url=https%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F676975902&#038;show_artwork=true&#038;maxwidth=1020&#038;maxheight=1000&#038;dnt=1&#038;auto_play=false&#038;buying=true&#038;liking=true&#038;download=true&#038;sharing=true&#038;show_comments=true&#038;show_playcount=true&#038;show_user=true&#038;color\"></iframe>			\n							<a href=\"https://www.facebook.com/profile.php?id=100007045987728\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n									</a>\n							<a href=\"https://twitter.com/tristanlalala\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n			<a href=\"http://204.48.23.153/page/ITI/Sistema/#\" role=\"button\">\n					</a>\n                	            <!--  /.icon -->\n                <h3>Mail</h3><!--  /.info-title -->\n                <p>sandrayaneth700@gmail.com</p>\n            <!--  /.details -->\n        <!--  /.contact-item -->', 'Home Dark', '', 'publish', 'closed', 'closed', '', 'home-dark', '', '', '2019-12-02 02:10:36', '2019-12-02 02:10:36', '', 0, 'http://intrinsic.softhopper.net/?page_id=55', 0, 'page', '', 0),
