(266, 1, '2019-11-19 23:35:04', '2019-11-19 23:35:04', '<!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"very-light-gray\",\"fontSize\":\"large\"} -->\n<p style=\"text-align:center\" class=\"has-background has-large-font-size has-very-light-gray-background-color\">\n\nUno de mis pasatiempos favoritos desde que tengo memoria es el dibujar, plasmar arte en una hoja con un simple lápiz, ver todo lo que puedes crear... \n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img/></figure>\n<!-- /wp:image -->', 'Pasatiempo favorito', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2019-11-19 23:35:04', '2019-11-19 23:35:04', '', 253, 'http://204.48.23.153/chanisdark/?p=266', 0, 'revision', '', 0),
(267, 1, '2019-11-19 23:38:55', '2019-11-19 23:38:55', '<!-- wp:heading -->\n<h2>En este apartado te mencionare uno de mis sueños.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-background has-very-dark-gray-color has-very-light-gray-background-color\">Primeramente, me ha llamado mucho la atención la ciberseguridad, incluso desde antes de entrar a la carrera, tenía un enfoque, no se algo me atrapaba de esta rama ya que en un futuro si me gustaría verme trabajando en algo parecido, porque en un futuro sabemos que ya van a existir millones de usuarios conectados a internet esto que al parecer es una buena noticia pero si lo vemos desde otro lado no tanto, ya que la amenazas van a aumentar</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><img class=\"wp-image-400\" style=\"width: 500px;\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/1500x844_gestionar_riesgos_cyberseguridad.jpg\" alt=\"\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"very-dark-gray\",\"backgroundColor\":\"very-light-gray\"} -->\n<p style=\"text-align:center\" class=\"has-text-color has-background has-very-dark-gray-color has-very-light-gray-background-color\">El diseño gráfico es otra cosa que me gustaría estudiar, si ya han visto mi página al 100% podrán darse cuenta de que me gusta mucho dibujar, me gustaría poder hacer ilustraciones, poder dibujar en tabletas o en computadoras especiales, incluso poder diseñar mi propio videojuego, o quizá que me ayude para cuando simplemente quiera crear diseños, animaciones, videos multimedia, la parte del diseño me gusta muchísimo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><img class=\"wp-image-403\" style=\"width: 500px;\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/Los-8-servicios-de-diseño-gráfico-más-solicitados-en-el-mercado.jpg\" alt=\"\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-background has-very-dark-gray-color has-very-light-gray-background-color\">Y por último pero no menos importante, me gusta enfocarme también en la arquitectura de las computadoras, ya que si no puedo cumplir mis anteriores sueños me gustaría saber armar, desarmar y poder arreglar computadoras y porque no en teléfonos también.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><img class=\"wp-image-404\" style=\"width: 500px;\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/2-Arquitectura-de-PCs.png\" alt=\"\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Como me veo en un futuro', '', 'publish', 'closed', 'closed', '', 'como-me-veo-en-un-futuro', '', '', '2019-11-30 20:21:54', '2019-11-30 20:21:54', '', 0, 'http://204.48.23.153/chanisdark/?page_id=267', 0, 'page', '', 0),
(268, 1, '2019-11-19 23:38:55', '2019-11-19 23:38:55', '<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-background has-very-dark-gray-color has-very-light-gray-background-color\">Apartado de como me veo en un futuro</p>\n<!-- /wp:paragraph -->', 'Como me veo en un futuro', '', 'inherit', 'closed', 'closed', '', '267-revision-v1', '', '', '2019-11-19 23:38:55', '2019-11-19 23:38:55', '', 267, 'http://204.48.23.153/chanisdark/?p=268', 0, 'revision', '', 0),
