(351, 1, '2019-11-29 21:46:34', '2019-11-29 21:46:34', '<!-- wp:paragraph -->\n<p>Uno de mis pasatiempos favoritos es el dibujar, dibujo desde que tengo memoria, porque dibujar me hace sentir tranquila y con paz, incluso si quisiera dibujar y me siento mal no podría, e aquí uno de mis muchos dibujos que no son todos, ya que estos son los que hice este año, debido al poco tiempo que eh tenido últimamente, es una de mis habilidades, poder recrear algo o solo imaginarlo y con un simple lápiz crear arte.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[\"334\",\"335\",\"337\",\"340\",\"341\",\"342\",347,349,350]} -->\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191124_155127_694-1-576x1024.jpg\" alt=\"\" data-id=\"334\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=334\" class=\"wp-image-334\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191124_155136_053-1-576x1024.jpg\" alt=\"\" data-id=\"335\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=335\" class=\"wp-image-335\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191124_155200_250-1-576x1024.jpg\" alt=\"\" data-id=\"337\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=337\" class=\"wp-image-337\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191124_155352-1-768x1024.jpg\" alt=\"\" data-id=\"340\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=340\" class=\"wp-image-340\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG_20191124_155357-1-1024x768.jpg\" alt=\"\" data-id=\"341\" data-link=\"http://204.4