(366, 1, '2019-11-29 22:37:51', '2019-11-29 22:37:51', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Experiencias dentro y fuera de la escuela</p>\n<!-- /wp:paragraph -->		\n			SANDRA<h2>Antecedentes escolares</h2>		\n		<p>Primero que nada yo me gradue del bachillerato NO° 236, anteriormente estuve en la secundaria Rafael Ramirez, más antes estuve en la primaria Elvira Saldaña Morales, quiero hablar acerca de algo que quizá desvió mucho lo que realmente yo quería en la vida, primero que nada yo desde niña siempre quise ser maestra, incluso aun estando en la secundaria quería seguir siendo maestra de eduación especial, inclusive entre al cbtis 236 solo por la especialidad de puericultura, cosa que a última hora termine escogiendo: Programación, un momento de mi vida si me arrepenti porque fue un giro muy inesperado, claro, no creo que tenga que ver mucho una carrera con otra. Cosa que no me arrepiento ni un segundo de mi vida, conocí personas que tuvieron un gran impacto en mi vida, y ahora estoy aquí, en la universidad Politécnica de Victoria, en la carrera de Tecnologías de la información</p>		\n										<img width=\"1020\" height=\"765\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-1024x768.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-1024x768.jpg 1024w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-300x225.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-768x576.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143.jpg 1280w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" />', 'Antecedentes escolares', '', 'inherit', 'closed', 'closed', '', '278-revision-v1', '', '', '2019-11-29 22:37:51', '2019-11-29 22:37:51', '', 278, 'http://204.48.23.153/chanisdark/?p=366', 0, 'revision', '', 0),
