(372, 1, '2019-11-30 16:46:54', '2019-11-30 16:46:54', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Experiencias dentro y fuera de la escuela</p>\n<!-- /wp:paragraph -->		\n			SANDRA<h2>Antecedentes escolares</h2>		\n		<p>Primero que nada yo me gradue del bachillerato No° 236, anteriormente estuve en la secundaria Rafael Ramirez, más antes estuve en la primaria Elvira Saldaña Morales, quiero hablar acerca de algo que quizá desvió mucho lo que realmente yo quería en la vida, primero que nada yo desde niña siempre quise ser maestra, incluso aun estando en la secundaria quería seguir siendo maestra de eduación especial, inclusive entre al cbtis 236 solo por la especialidad de puericultura, cosa que a última hora termine escogiendo: Programación, un momento de mi vida si me arrepentí porque fue un giro muy inesperado, claro, no creo que tenga que ver mucho una carrera con otra. Cosa que no me arrepiento ni un segundo de mi vida, conocí personas que tuvieron un gran impacto en mi vida, y ahora estoy aquí, en la universidad Politécnica de Victoria, en la carrera de Tecnologías de la información.</p>		\n										<img width=\"1020\" height=\"765\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-1024x768.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-1024x768.jpg 1024w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-300x225.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143-768x576.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/IMG-20191006-WA0143.jpg 1280w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" />											\n										<img width=\"199\" height=\"178\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/545.png\" alt=\"\" />											\n		<p>Yo ingrese al Centro de Bachillerato Tecnologico Industrial y de Servicios 236°, yo me había inclinado principalmente por puericultura, al final de cuentas por una razón que no me gusta mencionar pero a la vez agradezco mucho ya que gracias a eso yo estoy aquí estudiando en la Ingenieria de Tecnologías de la información. Los primeros semestres vimos bases de datos, java, diseño de páginas web, e-learning, comercio electronico, sistemas operativos entre muchas más, materias que fueron de mi agrado y gracias a eso, mi amor por la informática.</p>		\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=cd%20victoria%20tamaulipas%20cbtis%20236&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"cd victoria tamaulipas cbtis 236\"></iframe>', 'Antecedentes escolares', '', 'inherit', 'closed', 'closed', '', '278-revision-v1', '', '', '2019-11-30 16:46:54', '2019-11-30 16:46:54', '', 278, 'http://204.48.23.153/chanisdark/?p=372', 0, 'revision', '', 0),
(374, 1, '2019-11-30 16:58:42', '2019-11-30 16:58:42', '<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\">Uno de mis pasatiempos favoritos es el dibujar, dibujo desde que tengo memoria, porque dibujar me hace sentir tranquila y con paz, incluso si quisiera dibujar y me siento mal no podría, e aquí uno de mis muchos dibujos que no son todos, ya que estos son los que hice este año, debido al poco tiempo que eh tenido últimamente, es una de mis habilidades, poder recrear algo o solo imaginarlo y con un simple lápiz crear arte.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[]} -->\n<ul class=\"wp-block-gallery columns-0 is-cropped\"></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:quote {\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote is-style-large\"><p> Nunca olvides que todo comenzó cuando dibujé un simple ratón.</p><cite> -Walt Disney  </cite></blockquote>\n<!-- /wp:quote -->', 'Pasatiempo favorito', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2019-11-30 16:58:42', '2019-11-30 16:58:42', '', 253, 'http://204.48.23.153/chanisdark/?p=374', 0, 'revision', '', 0),
