(405, 1, '2019-11-30 20:01:26', '2019-11-30 20:01:26', '<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"very-dark-gray\",\"backgroundColor\":\"light-grayish-magenta\"} -->\n<p style=\"text-align:center\" class=\"has-text-color has-background has-very-dark-gray-color has-light-grayish-magenta-background-color\">Apartado de como me veo en un futuro :)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\">Primeramente, me ha llamado mucho la atención la ciberseguridad, incluso desde antes de entrar a la carrera, tenía un enfoque, no se algo me atrapaba de esta rama ya que en un futuro si me gustaría verme trabajando en algo parecido, porque en un futuro sabemos que ya van a existir millones de usuarios conectados a internet esto que al parecer es una buena noticia pero si lo vemos desde otro lado no tanto, ya que la amenazas van a aumentar.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[400]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/1500x844_gestionar_riesgos_cyberseguridad-1024x576.jpg\" alt=\"\" data-id=\"400\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=400\" class=\"wp-image-400\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\">El diseño gráfico es otra cosa que me gustaría estudiar, si ya han visto mi página al 100% podrán darse cuenta de que me gusta mucho dibujar, me gustaría poder hacer ilustraciones, poder dibujar en tabletas o en computadoras especiales, incluso poder diseñar mi propio videojuego, o quizá que me ayude para cuando simplemente quiera crear diseños, animaciones, videos multimedia, la parte del diseño me gusta muchisimo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[403]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/Los-8-servicios-de-diseño-gráfico-más-solicitados-en-el-mercado-1024x697.jpg\" alt=\"\" data-id=\"403\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=403\" class=\"wp-image-403\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\">Y por último pero no menos importante,  me gusta enfocarme tambíen en la arquitectura de las computadoras, ya que si no puedo cumplir mis anteriores sueños me gustaría saber armar, desarmar y poder arreglar computadoras y porque no en telefónos también.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[404]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/2-Arquitectura-de-PCs.png\" alt=\"\" data-id=\"404\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=404\" class=\"wp-image-404\"/></figure></li></ul>\n<!-- /wp:gallery -->', 'Como me veo en un futuro', '', 'inherit', 'closed', 'closed', '', '267-revision-v1', '', '', '2019-11-30 20:01:26', '2019-11-30 20:01:26', '', 267, 'http://204.48.23.153/chanisdark/?p=405', 0, 'revision', '', 0),
