(407, 1, '2019-11-30 20:06:03', '2019-11-30 20:06:03', '<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"very-light-gray\",\"backgroundColor\":\"light-grayish-magenta\"} -->\n<p style=\"text-align:center\">Apartado de como me veo en un futuro :)</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p>Primeramente, me ha llamado mucho la atención la ciberseguridad, incluso desde antes de entrar a la carrera, tenía un enfoque, no se algo me atrapaba de esta rama ya que en un futuro si me gustaría verme trabajando en algo parecido, porque en un futuro sabemos que ya van a existir millones de usuarios conectados a internet esto que al parecer es una buena noticia pero si lo vemos desde otro lado no tanto, ya que la amenazas van a aumentar.</p>\n<!-- /wp:paragraph -->\n<!-- wp:gallery {\"ids\":[400]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/1500x844_gestionar_riesgos_cyberseguridad-1024x576.jpg\" alt=\"\" data-id=\"400\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=400\"/></figure></li></ul>\n<!-- /wp:gallery -->\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p>El diseño gráfico es otra cosa que me gustaría estudiar, si ya han visto mi página al 100% podrán darse cuenta de que me gusta mucho dibujar, me gustaría poder hacer ilustraciones, poder dibujar en tabletas o en computadoras especiales, incluso poder diseñar mi propio videojuego, o quizá que me ayude para cuando simplemente quiera crear diseños, animaciones, videos multimedia, la parte del diseño me gusta muchisimo</p>\n<!-- /wp:paragraph -->\n<!-- wp:gallery {\"ids\":[403]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/Los-8-servicios-de-diseño-gráfico-más-solicitados-en-el-mercado-1024x697.jpg\" alt=\"\" data-id=\"403\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=403\"/></figure></li></ul>\n<!-- /wp:gallery -->\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p>Y por último pero no menos importante,  me gusta enfocarme tambíen en la arquitectura de las computadoras, ya que si no puedo cumplir mis anteriores sueños me gustaría saber armar, desarmar y poder arreglar computadoras y porque no en telefónos también.</p>\n<!-- /wp:paragraph -->\n<!-- wp:gallery {\"ids\":[404]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/2-Arquitectura-de-PCs.png\" alt=\"\" data-id=\"404\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=404\"/></figure></li></ul>\n<!-- /wp:gallery -->		\n				0\n							Años que faltan para esto', 'Como me veo en un futuro', '', 'inherit', 'closed', 'closed', '', '267-revision-v1', '', '', '2019-11-30 20:06:03', '2019-11-30 20:06:03', '', 267, 'http://204.48.23.153/chanisdark/?p=407', 0, 'revision', '', 0),
(408, 1, '2019-11-30 20:06:43', '2019-11-30 20:06:43', '<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"very-light-gray\",\"backgroundColor\":\"light-grayish-magenta\"} -->\n<p style=\"text-align:center\" class=\"has-text-color has-background has-very-light-gray-color has-light-grayish-magenta-background-color\"><p style=\"text-align:center\">Apartado de como me veo en un futuro :)</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\"><p>Primeramente, me ha llamado mucho la atención la ciberseguridad, incluso desde antes de entrar a la carrera, tenía un enfoque, no se algo me atrapaba de esta rama ya que en un futuro si me gustaría verme trabajando en algo parecido, porque en un futuro sabemos que ya van a existir millones de usuarios conectados a internet esto que al parecer es una buena noticia pero si lo vemos desde otro lado no tanto, ya que la amenazas van a aumentar.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[400]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/1500x844_gestionar_riesgos_cyberseguridad-1024x576.jpg\" alt=\"\" data-id=\"400\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=400\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\"><p>El diseño gráfico es otra cosa que me gustaría estudiar, si ya han visto mi página al 100% podrán darse cuenta de que me gusta mucho dibujar, me gustaría poder hacer ilustraciones, poder dibujar en tabletas o en computadoras especiales, incluso poder diseñar mi propio videojuego, o quizá que me ayude para cuando simplemente quiera crear diseños, animaciones, videos multimedia, la parte del diseño me gusta muchisimo</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[403]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/Los-8-servicios-de-diseño-gráfico-más-solicitados-en-el-mercado-1024x697.jpg\" alt=\"\" data-id=\"403\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=403\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\"><p>Y por último pero no menos importante,  me gusta enfocarme tambíen en la arquitectura de las computadoras, ya que si no puedo cumplir mis anteriores sueños me gustaría saber armar, desarmar y poder arreglar computadoras y porque no en telefónos también.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[404]} -->\n<ul><li><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/2-Arquitectura-de-PCs.png\" alt=\"\" data-id=\"404\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=404\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<p>0<br>\n							Años que faltan para esto</p>', 'Como me veo en un futuro', '', 'inherit', 'closed', 'closed', '', '267-revision-v1', '', '', '2019-11-30 20:06:43', '2019-11-30 20:06:43', '', 267, 'http://204.48.23.153/chanisdark/?p=408', 0, 'revision', '', 0),
