(415, 1, '2019-11-30 20:11:29', '2019-11-30 20:11:29', '<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"very-light-gray\",\"backgroundColor\":\"light-grayish-magenta\"} -->\n<p style=\"text-align:center\" class=\"has-text-color has-background has-very-light-gray-color has-light-grayish-magenta-background-color\"><p style=\"text-align:center\">Apartado de como me veo en un futuro :)</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[400]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/1500x844_gestionar_riesgos_cyberseguridad-1024x576.jpg\" alt=\"\" data-id=\"400\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=400\" class=\"wp-image-400\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-light-gray-background-color\"><p>Primeramente, me ha llamado mucho la atención la ciberseguridad, incluso desde antes de entrar a la carrera, tenía un enfoque, no se algo me atrapaba de esta rama ya que en un futuro si me gustaría verme trabajando en algo parecido, porque en un futuro sabemos que ya van a existir millones de usuarios conectados a internet esto que al parecer es una buena noticia pero si lo vemos desde otro lado no tanto, ya que la amenazas van a aumentar.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[403]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/11/Los-8-servicios-de-diseño-gráfico-más-solicitados-en-el-mercado-1024x697.jpg\" alt=\"\" data-id=\"403\" data-link=\"http://204.48.23.153/chanisdark/?attachment_id=403\" class=\"wp-image-403\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"very-light-gray\"} -->\n<p class=\"has-background has-very-l