(441, 1, '2019-12-01 04:58:11', '2019-12-01 04:58:11', '<h4>Mis gustos y démas</h4>		\n		<p>Algo que a mi en lo personal me gusta mucho son los super heroes, por todo lo que significan para mi, siempre buscan un bien común y el como le dan esperanza a las personas con una simple sonrisa, es lo que a mi me hace amarlos, incluso si son ficticios, llegan a ser mi motivación cuando no se como levantarme de los golpes de la vida.</p>		\n										<img width=\"768\" height=\"500\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/840653-768x500.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/840653-768x500.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/840653-300x195.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/840653-1024x667.jpg 1024w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p>All Might, el es un personaje protagonista del anime Boku No hero Academia, ha logrado atraparme en verdad ya que siempre le da esperanza a las personas con su simple sonrisa, a pesar de ya no poder mas siempre vas a admirar a este heroe, me gusta su ideología, querer salvar a todos, tiene ese carisma que te hace amarlo y admirarlo, por mucho es uno de mis favoritos.</p><p>Cápitan Ámerica, este personaje que quizá sea odiado por muchos es uno de mis favoritos por mucho tiempo, Steve Rogers fue un soldado que despertó 70 años después de la epoca en la que vivía, así tendiendo que dejar sin querer a la mujer que amaba, ¿dificíl no? Ser parte de la iniciativa avengers, siendo como uno de los mas fuertes y siendo ese símbolo para demostrarnos que el mal puede ser confrontado y golpeado. Si has visto End Game no me puedes decir que la escena de Steve Rogers con Thanos no te emociono.</p>		\n										<img width=\"1020\" height=\"574\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/25152bf1f675955967e69bbcf3ac9f07-1024x576.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/25152bf1f675955967e69bbcf3ac9f07-1024x576.jpg 1024w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/25152bf1f675955967e69bbcf3ac9f07-300x169.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/25152bf1f675955967e69bbcf3ac9f07-768x432.jpg 768w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" />											\n										<img width=\"300\" height=\"168\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/images.jpg\" alt=\"\" />											\n		<p>Spiderman, este personaje me ha inspirado mucho, porque es tan increíble su multiverso y todo lo que respecta, hablemos de Peter Parker uno de los mas famosos portadores de la máscara, ya que no es el único que puede portarla, como ya hemos visto en la última entrega de Spiderman Into Tht Spideverse, nos podemos dar cuenta de que existen en otras dimensiones otros portadores de la máscara, dandonos a entender que cualquiera puede usarla, cualquiera puede ser el afortunado de ser mordido por la araña. No importa cuantas veces me caiga siempre encuentro la forma de levantarme, es una de mis frases favoritas de este super heroe.</p>https://www.youtube.com/watch?v=BBjU06ETaaIhttps://www.youtube.com/watch?v=favVWVagesMhttps://www.youtube.com/watch?v=yFbPbiBhipw', 'Gustos', '', 'inherit', 'closed', 'closed', '', '431-revision-v1', '', '', '2019-12-01 04:58:11', '2019-12-01 04:58:11', '', 431, 'http://204.48.23.153/chanisdark/?p=441', 0, 'revision', '', 0),
(442, 1, '2019-12-01 05:10:28', '2019-12-01 05:10:28', '<h2>Mis personas favoritas</h2>		\n		<p>Jesús, muchos quizá pensaran o se burlaran, por que sí, el es mi novio y es de las personas que justo ahora es a la cual le agradezco todo, porque desde un principio llegó a mi vida en un momento muy critico, en verdad cuando digo que me salvó, es porque lo hizo, siempre me ayudo cuando yo ya no podía más, alegraba mis días cuando yo ya no les veía sentido.</p>		\n										<img width=\"300\" height=\"300\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-300x300.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-300x300.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-150x150.jpg 150w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-768x768.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-600x600.jpg 600w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou.jpg 960w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n		<p>Aún con eso el nunca se fue, cuando por fin lo conocí en persona fue como si ya lo conociera de años y simplemente agradecía por todo lo malo que me pasó, porque gracias a eso conocí a esta maravillosa persona que siempre me ha impulsado a salir adelante, que a donde quiera que vaya siempre va a brillar, nunca voy a agradecerte por salvarme, por darle estabilidad a mi vida y hacerla mejor cada día &lt;3</p>		\n										<img width=\"768\" height=\"496\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-768x496.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-768x496.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-300x194.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725.jpg 1024w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p>Se que no es una persona, pero es un miembro de mi familia, y el bien que nos ha echo desde su llegada, el significado que tiene para nosotros, es mi mejor amigo porque siempre me saca sonrisas, cuando estoy triste siempre esta ahí tratando solo de entender porque a veces no quiero jugar, es tan adorable y tierno, todos saben la importancia que tiene en mi vida y cuanto lo quiero, es el chihuahua mas hermoso de todos.</p><p>Michito es un gatito que llego a mi casa hace poco mas de un mes, cabe recalcar que a mi no me gustan para nada los gatos por el motivo de que todos los que había tenido se iban y nunca regresaban o simplemente no me querían, michito desde un principio como era rescatado de la calle era muy pequeño y débil, pero con el tiempo fue tomando fuerzas y siempre dormía en mi pecho, se acostumbró a mi hogar y ahora es parte de la familia, a veces en las mañanas me acompaña a tomar el autobus para irme a la escuela, o me ronronea mucho, le he llegado a tomar mucho cariño y ahora es muy importante para mi</p>		\n										<img width=\"768\" height=\"570\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-768x570.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-768x570.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-300x223.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953.jpg 1024w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<a href=\"https://www.youtube.com/watch?v=WM62OS4zIik\" role=\"button\">\n					</a>', 'Personas importantes en mi vida...', '', 'publish', 'closed', 'closed', '', 'personas-importantes-en-mi-vida', '', '', '2019-12-01 06:43:09', '2019-12-01 06:43:09', '', 0, 'http://204.48.23.153/chanisdark/?page_id=442', 0, 'page', '', 0),
