(450, 1, '2019-12-01 06:15:52', '2019-12-01 06:15:52', '<h2>Mis personas favoritas</h2>		\n		<p>Jesús, muchos quizá pensaran o se burlaran, por que sí, el es mi novio y es de las personas que justo ahora es a la cual le agradezco todo, porque desde un principio llegó a mi vida en un momento muy critico, en verdad cuando digo que me salvó, es porque lo hizo, siempre me ayudo cuando yo ya no podía más, alegraba mis días cuando yo ya no les veía sentido.</p>		\n										<img width=\"300\" height=\"300\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-300x300.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-300x300.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-150x150.jpg 150w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-768x768.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou-600x600.jpg 600w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_z7gmou.jpg 960w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n		<p>Aún con eso el nunca se fue, cuando por fin lo conocí en persona fue como si ya lo conociera de años y simplemente agradecía por todo lo malo que me pasó, porque gracias a eso conocí a esta maravillosa persona que siempre me ha impulsado a salir adelante, que a donde quiera que vaya siempre va a brillar, nunca voy a agradecerte por salvarme, por darle estabilidad a mi vida y hacerla mejor cada día &lt;3</p>		\n										<img width=\"768\" height=\"496\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-768x496.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-768x496.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725-300x194.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20190326_121725.jpg 1024w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p>Se que no es una persona, pero es un miembro de mi familia, y el bien que nos ha echo desde su llegada, el significado que tiene para nosotros, es mi mejor amigo porque siempre me saca sonrisas, cuando estoy triste siempre esta ahí tratando solo de entender porque a veces no quiero jugar, es tan adorable y tierno, todos saben la importancia que tiene en mi vida y cuanto lo quiero, es el chihuahua mas hermoso de todos.</p><p>Michito es un gatito que llego a mi casa hace poco mas de un mes, cabe recalcar que a mi no me gustan para nada los gatos por el motivo de que todos los que había tenido se iban y nunca regresaban o simplemente no me querían, michito desde un principio como era rescatado de la calle era muy pequeño y débil, pero con el tiempo fue tomando fuerzas y siempre dormía en mi pecho, se acostumbró a mi hogar y ahora es parte de la familia, a veces en las mañanas me acompaña a tomar el autobus para irme a la escuela, o me ronronea mucho, le he llegado a tomar mucho cariño y ahora es muy importante para mi</p>		\n										<img width=\"768\" height=\"570\" src=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-768x570.jpg\" alt=\"\" srcset=\"http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-768x570.jpg 768w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953-300x223.jpg 300w, http://204.48.23.153/chanisdark/wp-content/uploads/2019/12/IMG_20191109_173953.jpg 1024w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<a href=\"https://www.youtube.com/watch?v=WM62OS4zIik\" role=\"button\">\n					</a>', 'Personas importantes en mi vida...', '', 'inherit', 'closed', 'closed', '', '442-revision-v1', '', '', '2019-12-01 06:15:52', '2019-12-01 06:15:52', '', 442, 'http://204.48.23.153/chanisdark/?p=450', 0, 'revision', '', 0),
